House of Champions 🏆
@boxrgym

Epic is an understatement if we are talking about Friday night. It was pouring raining and my loved ones still pulled up to celebrate life with me. When I walked in the door and saw everybody smiling and cheering me on I could have shed a tear in happiness. Before I did anything else, I walked up to every single person and told them “I love you & appreciate you”. The love that was there was unmatched and I’m so thankful that God brought everyone that was there in my life that night 

If you know me, you know I go out my way daily to let people know that I see them. It’s natural and 100% genuine. It’s the love that I have for people that God placed in my spirit since birth. God is good!

@calliraexo you did that! You always show up and show out for me and I’m forever grateful. Love you

